import { StatusBar } from "expo-status-bar";
import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  View,
  Image,
  TextInput,
  TouchableOpacity,
} from "react-native";
import HomeScreen from "./src/screens/HomeScreen";


const AppNavigator = createStackNavigator(  
  {  
      Login: LoginScreen,  
  },  
  {  
      initialRouteName: "Login"  
  }  
);  

const AppContainer = createAppContainer(AppNavigator);  

export default class App {  
    render() {  
        return <AppContainer />;  
    }  
}  


const styles = StyleSheet.create({

  container: {
    flex: 1,
    backgroundColor: "#008080",
    alignItems: "center",
    justifyContent: "center",
  },

  image: {
    width: 200, 
    height: 200,
    marginBottom: 100,
  },

  inputView: {
    backgroundColor: "#CCCCFF",
    borderRadius: 30,
    width: "70%",
    height: 45,
    marginBottom: 20,

    alignItems: "center",
  },

  TextInput: {
    height: 50,
    flex: 1,
    padding: 10,
    marginLeft: 20,
  },

  forgot_button: {
    height: 30,
    marginBottom: 30,
  },

  loginBtn: {
    width: "80%",
    borderRadius: 25,
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 40,
    backgroundColor: "#89CFF0",
  },
});
